const fs = require('fs');
const path = require('path');

// Base64-encoded favicon files generated from logo-dark.svg
const files = {
  'app/favicon.ico': '',
  'app/icon.png': '',
  'app/apple-icon.png': '',
  'public/icon-192.png': '',
  'public/icon-512.png': '',
};

// Also copy the SVG favicon
const svgContent = `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" width="32" height="32">
  <rect width="32" height="32" fill="#121418" rx="6"/>
  <path d="M16 3 L27 9.5 V22.5 L16 29 L5 22.5 V9.5 Z" stroke="#00C2CB" stroke-width="2" stroke-linejoin="round" fill="none"/>
  <circle cx="16" cy="16" r="4" fill="#00C2CB"/>
  <circle cx="25" cy="6" r="1.5" fill="#00C2CB"/>
</svg>`;

const wwwRoot = path.resolve(__dirname);

console.log('Installing favicon files for www.ironscout.ai...\n');

// Write binary files
for (const [relPath, b64] of Object.entries(files)) {
  const fullPath = path.join(wwwRoot, relPath);
  fs.writeFileSync(fullPath, Buffer.from(b64, 'base64'));
  console.log(`   ${relPath}`);
}

// Write SVG
const svgPath = path.join(wwwRoot, 'app/icon.svg');
fs.writeFileSync(svgPath, svgContent);
console.log(`   app/icon.svg`);

console.log('\nDone! Next.js App Router auto-detects these files:');
console.log('  - app/favicon.ico   /favicon.ico');
console.log('  - app/icon.png      /icon.png (32x32)');
console.log('  - app/icon.svg      /icon.svg (scalable)');
console.log('  - app/apple-icon.png  /apple-icon.png (180x180)');
console.log('\nNo layout.tsx changes needed.');
